const LOG_10 = Math.log(10);

export const UNDEF_COLOR_HEX = 'c8c8c8';
export const UNDEF_COLOR = 'rgb(200,200,200)';
// export const UNDEF_COLOR_RGB = [200,200,200];

const MAX_INDEX = 10000;
const FINE_GRAIN_THRESHOLD = 50;

export class ColorChooser {

  getPaletteSourceIndex(count: number) : string {
    let paletteSourceIndex = Math.ceil(count/10)*10;
    if (count > FINE_GRAIN_THRESHOLD) {
      const exponent = Math.ceil(Math.log(count) / LOG_10);
      paletteSourceIndex = Math.pow(10, exponent);
      if (count <= paletteSourceIndex / 2) {
        paletteSourceIndex /= 2;
      }
    }
    return `${paletteSourceIndex}`;
  }


  getPalette(count: number) : string[] {
    let src: string[] = [];
    if (count > 0 && count <= MAX_INDEX) {
      const paletteSourceIndex = this.getPaletteSourceIndex(count);
      src = PALETTE_SOURCES[paletteSourceIndex];
    } else {
      const maxKey = `${MAX_INDEX}`;
      let src = PALETTE_SOURCES[maxKey];
      while (src.length < count) {
        src = src.concat(PALETTE_SOURCES[maxKey]);
      }
    }
    return src.slice(0, count);
  }



  getUndefColor(): string {
    return UNDEF_COLOR_HEX;
  }


}




